import React from 'react'
import './Card.css';
import Todo from './Todo';
import Data from  './Data.json';

function Card() {

console.log(Data);
  return (
    <div className="container">
      <Todo title="title1"  desc="desc1" />
      <Todo title="title2"  desc="desc2" />
      <Todo title="title1"  desc="desc1" />
      <Todo title={title}  desc={desc} />
      <Todo title={title}  desc={desc} />
      <Todo/>
  </div>
  )
}

export default Card
